import React, { useState, useEffect } from 'react';
import Sidebar from '../components/Sidebar';
import Footer from '../components/Footer';
import { parseJwt } from '../utils/jwt';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const AddProductPage = () => {
  const [username, setUsername] = useState('');
  const [form, setForm] = useState({ name: '', quantity: '', price: '' });
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (token) {
      const payload = parseJwt(token);
      setUsername(payload?.username || '');
    }
  }, []);

  const handleChange = e => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async e => {
    e.preventDefault();
    setError(''); setSuccess(''); setLoading(true);
    try {
      const token = localStorage.getItem('token');
      await axios.post('http://localhost:5000/products/add', {
        name: form.name,
        quantity: Number(form.quantity),
        price: Number(form.price)
      }, {
        headers: { Authorization: `Bearer ${token}` }
      });
      setSuccess('Ürün başarıyla eklendi!');
      setTimeout(() => navigate('/products'), 1200);
    } catch (err) {
      setError('Ürün eklenemedi!');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={{ minHeight: '100vh', background: '#f4f6fa', display: 'flex' }}>
      <Sidebar username={username} />
      <div style={{ marginLeft: 200, flex: 1, minHeight: '100vh', display: 'flex', flexDirection: 'column' }}>
        <div style={{ flex: 1, display: 'flex', alignItems: 'flex-start', justifyContent: 'center', paddingTop: 60 }}>
          <div style={{ width: '100%', maxWidth: 400, background: '#fff', borderRadius: 10, boxShadow: '0 2px 12px #0001', padding: 32 }}>
            <h2 style={{ color: '#365256', marginBottom: 24 }}>Ürün Ekle</h2>
            <form onSubmit={handleSubmit}>
              <input
                name="name"
                placeholder="Ürün Adı"
                value={form.name}
                onChange={handleChange}
                required
                style={{ width: '100%', marginBottom: 14, padding: 10, borderRadius: 6, border: '1.5px solid #D8CBC3', fontSize: 16 }}
              />
              <input
                name="quantity"
                type="number"
                placeholder="Miktar"
                value={form.quantity}
                onChange={handleChange}
                required
                min={1}
                style={{ width: '100%', marginBottom: 14, padding: 10, borderRadius: 6, border: '1.5px solid #D8CBC3', fontSize: 16 }}
              />
              <input
                name="price"
                type="number"
                step="0.01"
                placeholder="Fiyat"
                value={form.price}
                onChange={handleChange}
                required
                min={0}
                style={{ width: '100%', marginBottom: 18, padding: 10, borderRadius: 6, border: '1.5px solid #D8CBC3', fontSize: 16 }}
              />
              <button
                type="submit"
                disabled={loading}
                style={{ width: '100%', padding: 12, background: '#365256', color: '#fff', fontWeight: 'bold', fontSize: 17, border: 'none', borderRadius: 6, cursor: 'pointer', marginTop: 4 }}
              >
                {loading ? 'Ekleniyor...' : 'Ekle'}
              </button>
              {error && <div style={{ color: '#b00020', marginTop: 12 }}>{error}</div>}
              {success && <div style={{ color: '#09DF52', marginTop: 12 }}>{success}</div>}
            </form>
          </div>
        </div>
        <Footer />
      </div>
    </div>
  );
};

export default AddProductPage;
